import React from "react";

function Home() {
  return (
<div>
      <h1>Recipe Search</h1>
        <input
            value={query}
            onChange={changeHandler}
          />

      {data.hits.map(item => {
        return (
          <RecipeList 
            image={item.recipe.image}
            name={item.recipe.label}
            view='View Recipe'
            id={item.recipe.totalWeight}
            />
        )
      })}

      <div>
        <Switch>
          <Route exact path='/' component={Home}/>
          <Route path='/recipes/:id'>
            <Recipe food={data.hits}/>
          </Route>
          <Route path='/recipes' component={RecipeList}/>
        </Switch>
      </div>
    </div>
  )
}

export default Home;
